import React, { useEffect, useState } from 'react';
import cx from 'classnames';
import screenfull from 'screenfull';
import { Tooltip, Slider, Popover, Row, Col, Divider, Button } from 'antd';
import {
  UndoOutlined, RedoOutlined, FullscreenOutlined, FullscreenExitOutlined, AppstoreOutlined,
  SaveOutlined, FontColorsOutlined, QuestionCircleOutlined, PictureOutlined, ReloadOutlined,
} from '@ant-design/icons';
import formatMessage from '../locales';
import './Toolbar.scss';

interface Props {
  undoDisabled: boolean;
  redoDisabled: boolean;
  undo: () => void;
  redo: () => void;
  pointSize: number;
  setPointSize: (size: number) => void;
  lineWidth: number;
  setLineWidth: (size: number) => void;
  isFullScreen: boolean;
  setFullScreen: (full: boolean) => void;
  isGridVisible: boolean;
  setGridVisible: (visible: boolean) => void;
  isLabelVisible: boolean;
  setLabelVisible: (visible: boolean) => void;
  onFiltersChange: (filters: {[key: string]: number}) => void;
  onSave: () => void;
  isPreview: boolean;
}

const defaultFilters = {
  brightness: 0,
  contrast: 0,
  saturation: 0,
  lightness: 0,
  hue: 0,
  rescale: 1,
};

export default ({
  undoDisabled,
  redoDisabled,
  undo,
  redo,
  pointSize,
  setPointSize,
  lineWidth,
  setLineWidth,
  isFullScreen,
  setFullScreen,
  isGridVisible,
  setGridVisible,
  isLabelVisible,
  setLabelVisible,
  onSave,
  onFiltersChange,
  isPreview,
}: Props) => {
  const [filtersVisible, setFiltersVisible] = useState(false);
  const [filters, setFilters] = useState(defaultFilters);

  useEffect(() => {
    onFiltersChange(filters);
  }, [filters]);

  const handleScreenFull = () => {
    if (screenfull.isEnabled) {
      if (isFullScreen) {
        screenfull.exit();
      } else {
        screenfull.request();
      }
      setFullScreen(!isFullScreen);
    }
  };

  const FilterContent = (
    <Row style={{ width: 300 }} gutter={16} align="middle">
      <Col span={24} style={{ textAlign: 'right' }}>
        <Button type="link" style={{ color: '#f5f5f5' }} icon={<ReloadOutlined />} onClick={() => setFilters(defaultFilters)}>
          {formatMessage('FILTER_RESET')}
        </Button>
      </Col>
      <Col span={6}>
        {formatMessage('FILTER_BRIGHTNESS')}
      </Col>
      <Col span={18}>
        <Slider
          className="landmark-slider"
          min={-100}
          max={100}
          step={1}
          value={filters.brightness}
          onChange={(v: number) => setFilters({ ...filters, brightness: v })}
        />
      </Col>
      <Col span={6}>
        {formatMessage('FILTER_CONTRAST')}
      </Col>
      <Col span={18}>
        <Slider
          className="landmark-slider"
          min={-100}
          max={100}
          step={1}
          value={filters.contrast}
          onChange={(v: number) => setFilters({ ...filters, contrast: v })}
        />
      </Col>
      <Col span={6}>
        {formatMessage('FILTER_SATURATION')}
      </Col>
      <Col span={18}>
        <Slider
          className="landmark-slider"
          min={-100}
          max={100}
          step={1}
          value={filters.saturation}
          onChange={(v: number) => setFilters({ ...filters, saturation: v })}
        />
      </Col>
      <Col span={6}>
        {formatMessage('FILTER_LIGHTNESS')}
      </Col>
      <Col span={18}>
        <Slider
          className="landmark-slider"
          min={-100}
          max={100}
          step={1}
          value={filters.lightness}
          onChange={(v: number) => setFilters({ ...filters, lightness: v })}
        />
      </Col>
      <Col span={6}>
        {formatMessage('FILTER_HUE')}
      </Col>
      <Col span={18}>
        <Slider
          className="landmark-slider"
          min={-180}
          max={180}
          step={1}
          value={filters.hue}
          onChange={(v: number) => setFilters({ ...filters, hue: v })}
        />
      </Col>
      <Col span={6}>
        {formatMessage('FILTER_RESCALE')}
      </Col>
      <Col span={18}>
        <Slider
          className="landmark-slider"
          min={1}
          max={5}
          step={0.01}
          value={filters.rescale}
          onChange={(v: number) => setFilters({ ...filters, rescale: v })}
        />
      </Col>
    </Row>
  );

  const HelpContent = (
    <Row style={{ width: 400 }} gutter={16} align="top">
      <Col span={24}>
        <Divider plain><b>{formatMessage('HELP_TITLE_POINTS')}</b></Divider>
      </Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">Delete</span>
        {' / '}
        <span className="help-button">Backspace</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_POINTS_DELETE')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">V</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_POINTS_VISIBLE')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">A</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_POINTS_ADJUST')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">C</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_POINTS_SMOOTH')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">O</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_POINTS_CIRCLE')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">Ctrl</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_POINTS_FORCE')}</Col>
      <Col span={24}>
        <Divider plain><b>{formatMessage('HELP_TITLE_EDITOR')}</b></Divider>
      </Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">Z</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_UNDO')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">Y</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_REDO')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">L</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_LABEL')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">G</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_GRID')}</Col>
      <Col span={10} className="help-buttons">
        <span className="help-button">F</span>
      </Col>
      <Col span={14}>{formatMessage('HELP_FULLSCREEN')}</Col>
    </Row>
  );

  return (
    <div className="toolbar">
      <div>
        <div
          className={cx('icon-button', {
            'icon-button--disabled': undoDisabled
          })}
          onClick={undo}
        >
          <Tooltip
            title={formatMessage('TOOLBAR_UNDO', { values: { shortcut: 'Z' } })}
            placement="bottom"
          >
            <UndoOutlined />
          </Tooltip>
        </div>
        <div
          className={cx('icon-button', {
            'icon-button--disabled': redoDisabled
          })}
          onClick={redo}
        >
          <Tooltip
            title={formatMessage('TOOLBAR_REDO', { values: { shortcut: 'Y' } })}
            placement="bottom"
          >
            <RedoOutlined />
          </Tooltip>
        </div>
        <div className="divider" />
        <div className="slider-container">
          <span>{formatMessage('TOOLBAR_POINT_RADIUS')}</span>
          <Slider className="landmark-slider" min={1} max={10} step={1} value={pointSize} onChange={setPointSize} />
        </div>
        <div className="slider-container">
          <span>{formatMessage('TOOLBAR_LINE_WIDTH')}</span>
          <Slider className="landmark-slider" min={0} max={5} step={1} value={lineWidth} onChange={setLineWidth} />
        </div>
      </div>
      <div>
        <div
          className="icon-button"
        >
          <Popover
            overlayClassName="landmark-popover"
            content={FilterContent}
            placement="bottomRight"
            trigger="click"
            visible={filtersVisible}
            onVisibleChange={(visible) => setFiltersVisible(visible)}
          >
            <Tooltip
              title={formatMessage('TOOLBAR_FILTERS')}
              placement="bottom"
            >
              <PictureOutlined />
            </Tooltip>
          </Popover>
        </div>
        <div
          className={cx('icon-button', {
            'icon-button--active': isLabelVisible
          })}
          onClick={() => setLabelVisible(!isLabelVisible)}
        >
          <Tooltip
            title={formatMessage(isLabelVisible ? 'TOOLBAR_LABEL_HIDE' : 'TOOLBAR_LABEL_SHOW', { values: { shortcut: 'L' } })}
            placement="bottom"
          >
            <FontColorsOutlined />
          </Tooltip>
        </div>
        <div
          className={cx('icon-button', {
            'icon-button--active': isGridVisible
          })}
          onClick={() => setGridVisible(!isGridVisible)}
        >
          <Tooltip
            title={formatMessage(isGridVisible ? 'TOOLBAR_GRID_HIDE' : 'TOOLBAR_GRID_SHOW', { values: { shortcut: 'G' } })}
            placement="bottom"
          >
            <AppstoreOutlined />
          </Tooltip>
        </div>
        <div
          className={cx('icon-button', {
            'icon-button--disabled': isPreview
          })}
          onClick={onSave}
        >
          <Tooltip
            title={formatMessage('TOOLBAR_SAVE', { values: { shortcut: 'S' } })}
            placement="bottom"
          >
            <SaveOutlined />
          </Tooltip>
        </div>
        <div className="divider" />
        <div className="icon-button">
          <Popover overlayClassName="landmark-popover" content={HelpContent} placement="bottomRight">
            <QuestionCircleOutlined />
          </Popover>
        </div>
        <div className="icon-button" onClick={handleScreenFull}>
          <Tooltip
            title={formatMessage(isFullScreen ? 'TOOLBAR_FULLSCREEN_EXIST' : 'TOOLBAR_FULLSCREEN_ENTER', { values: { shortcut: 'F' } })}
            placement="bottom"
          >
            {isFullScreen ? <FullscreenExitOutlined /> : <FullscreenOutlined />}
          </Tooltip>
        </div>
      </div>
    </div>
  );
};
